pragma solidity >=0.4.22 <0.7.0;


interface TokenToExchange {
    function transfer(address _to, uint256 _value) external returns (bool success);
    function transferFromOrigin(address _to, uint256 _value) external returns (bool success);
}

interface AccessToExchange{
    function inSuperAdmins(address a) external returns (bool success);
}

contract Exchange {
    TokenToExchange token = TokenToExchange(0x241379715A7aB2958976a237c26d2E1986b55A9b);
    AccessToExchange access = AccessToExchange(0x7d407640d25f023Dadf414888515940D3ff298e2);

    address owner;
    uint price;

    constructor() public 
    {
       owner = msg.sender;
       price = 10000; //1eth=10000lark
    }

    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }

    //给合约转以太币以换取代币
    receive() external 
        payable 
    { 
        token.transfer(msg.sender, msg.value * price);
    }

    fallback () external payable { }

    function larkToEth(uint _amount) 
        public
        payable
    {
        token.transferFromOrigin(address(this), _amount);
        msg.sender.transfer(_amount / price);
    }

    function setPrice(uint _price)
        public
    {
        require(msg.sender == owner || access.inSuperAdmins(msg.sender));
        price = _price;
    }

    function getThis() 
        public
        view
        returns(address)
    {
        return address(this);
    }

    function getMessage()
        public
        view
        returns(address, uint)
    {
        return (owner, price);
    }

    function withdrawEth(uint _amount)
        public
        onlyOwner
    {
        msg.sender.transfer(_amount);
    }

    function withdrawLark(uint _amount)
        public
        onlyOwner
    {
        token.transfer(msg.sender, _amount);
    }

}
